import {Row, Col } from 'antd';
import './ContactUs.css';

class ContactUs extends Component {
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div className="contact-container">
                <Row>
                    <Col xs={24}>
                        <div className="contact-section">

                        </div>
                    </Col>
                </Row>
            </div>
        )
    }
}
export default ContactUs;
